import "./Toolbar.css";

const Toolbar = () => {
  return (
    <>
      <div>
        <div className="toolbar-left">
        <div className="fd-clearbox">
          <div className="header">
            <label>Khám phá</label>
            <ul className="list-toolbar">
              <li>Mới nhất</li>
              <li>Sưu tập</li>
              <li>Bình luận</li>
              <li>Khuyến mãi</li>
            </ul>
          </div>
        </div>
      </div>
      </div>
    </>
  );
};

export default Toolbar;
